import React, { useState } from 'react'
var count = 0, sign

export const Tictac = () => {
    const [val, setVal] = useState([' ', ' ', ' ', ' ', ' ', ' ', ' ', ' ', ' '])

    function run(i) {
        if (count % 2 == 0) {
            sign = "X"
        } else {
            sign = "O"
        }

        if (val[i] == ' ') {
            setValues(i)

        }

      


        console.log(val);
    }

    function setValues(i) {
        
        setVal(val.map((item, ind) => {
            return ind == i ? item = sign : item
        }))

        count++
    }
    return (
        <>
            <button style={{padding: "20px"}} onClick={() => run(0)}>{val[0]}</button>
            <button style={{padding: "20px"}} onClick={() => run(1)}>{val[1]}</button>
            <button style={{padding: "20px"}} onClick={() => run(2)}>{val[2]}</button><br></br>
            <button style={{padding: "20px"}} onClick={() => run(3)}>{val[3]}</button>
            <button style={{padding: "20px"}} onClick={() => run(4)}>{val[4]}</button>
            <button style={{padding: "20px"}} onClick={() => run(5)}>{val[5]}</button><br></br>
            <button style={{padding: "20px"}} onClick={() => run(6)}>{val[6]}</button>
            <button style={{padding: "20px"}} onClick={() => run(7)}>{val[7]}</button>
            <button style={{padding: "20px"}} onClick={() => run(8)}>{val[8]}</button><br></br>
        </>
    )
}
